import React from 'react';

export default function HeroCardStats(props) {
    console.log(props.stats);
    let stats = props.stats,
        combat = stats.combat,
        durability = stats.durability,
        intelligence = stats.intelligence,
        power = stats.power,
        speed = stats.speed,
        strength = stats.strength;
    return (
        <>
            <li className="list-group-item">{combat}</li>
            <li className="list-group-item">{durability}</li>
            <li className="list-group-item">{intelligence}</li>
            <li className="list-group-item">{power}</li>
            <li className="list-group-item">{speed}</li>
            <li className="list-group-item">{strength}</li>
        </>
    );
}
